def  left45Degrees():
    np_image = np.array(vertical_guide_image_data).reshape(128,128)

    for i in range(64):
        np_image[i][63] = 0

    for i in range(63, -1, -1):
        np_image[i][i] = 255
    plt.imshow(np_image, cmap='gray')
    plt.show()
    return np_image.reshape(128*128).tolist()

def  right45Degrees():
    np_image = np.array(vertical_guide_image_data).reshape(128,128)

    for i in range(64):
        np_image[i][63] = 0

    for i in range(63, -1, -1):
        np_image[i][127-i] = 255

    plt.imshow(np_image, cmap='gray')
    plt.show()
    return np_image.reshape(128*128).tolist()

def  left23Degrees():
    np_image = np.array(vertical_guide_image_data).reshape(128,128)

    for i in range(64):
        np_image[i][63] = 0

    for i in range(63, -1, -1):
        np_image[i][floor(i/2) + 32] = 255
    plt.imshow(np_image, cmap='gray')
    plt.show()
    return np_image.reshape(128*128).tolist()


def  right23Degrees():
    np_image = np.array(vertical_guide_image_data).reshape(128,128)

    for i in range(64):
        np_image[i][63] = 0

    for i in range(63, -1, -1):
        np_image[i][127-32-floor(i/2)] = 255
    plt.imshow(np_image, cmap='gray')
    plt.show()
    return np_image.reshape(128*128).tolist()

